import React from 'react';
import Project from "../components/Projects";

export default function Projects(props) {
    return (
        <div>
            <div className="projects">
                <h1>Projects</h1>
            </div>
            <div className="project-examples">
                <Project />
            </div>
        </div>
    );
}
